					createJoystick: function()
					{


						if(!app.game.enableJoystick){
							return;
						}

						game.pad;
						game.stick;

						game.buttonA;
						game.buttonB;
						game.buttonC;


						game.pad =  game.plugins.add(Phaser.VirtualJoystick);

						game.stick = game.pad.addStick(0, 0, 200, 'joystickAtlas');
						//game.stick.alignBottomLeft();
						game.stick.showOnTouch = true;
						game.stick.scale = 0.5;

						/*
						NOT IMPLEMENTED
						// Only enable Stick down on left half of game
						// remove default handler
						game.stick.pad.game.input.onDown.remove(stick.checkDown, stick);
						// add in your own
						game.input.onDown.add(function (pointer) {  
							if (pointer.x < game.width / 2)  {
							    // right place? then call the Sticks checkDown method    
							    game.stick.checkDown(pointer);  
							}
						}, this);

						*/

						game.spaceKey = game.input.keyboard.addKey(Phaser.Keyboard.SPACEBAR);
						game.controlKey = game.input.keyboard.addKey(Phaser.Keyboard.CONTROL);
						game.shiftKey = game.input.keyboard.addKey(Phaser.Keyboard.SHIFT);


						// on 800x600 game, buttons are at 
						//    A: 500,520
						//    B: 615,450
						//    C: 730,520
						//    Buttons must take up max 1/2 the width, and 1/4 height
						//    x spacing is max 115 or 15% of width
						//    y spacing is max 70 or 15% of height
						//    Button Scale: if game width < 600, scale down button size proportionately
						
						var xSpace = 115;
						if(game.width*0.15 < xSpace){xSpace = game.width*0.15;}
						var ySpace = 70;
						if(game.heigth*0.15 < ySpace){ySpace = game.height*0.15;}
						var buttonScale = 1;
						if(game.width<600){buttonScale = (600+game.width)/3/600;}


						game.buttonA = game.pad.addButton((game.width-(3*xSpace)), (game.height-ySpace), 'joystickAtlas', 'button1-up', 'button1-down');
						game.buttonA.scale = buttonScale;

						game.buttonA.onDown.add( app.game.pressButtonA, game);
						game.buttonA.onUp.add( app.game.upButtonA, game);

						game.buttonB = game.pad.addButton((game.width-(2*xSpace)), (game.height-(2*ySpace)), 'joystickAtlas', 'button2-up', 'button2-down');
						game.buttonB.scale = buttonScale;
						game.buttonB.onDown.add(app.game.pressButtonB, game);
						game.buttonB.onUp.add(app.game.upButtonB, game); 


						game.buttonC = game.pad.addButton((game.width-xSpace), (game.height-ySpace), 'joystickAtlas', 'button3-up', 'button3-down');
						game.buttonC.scale = buttonScale;
						game.buttonC.onDown.add(app.game.pressButtonC, game);
						game.buttonC.onUp.add(app.game.upButtonC, game);

                    },
				
					createGyro: function(player)
					{


						if(!app.game.enableGyro){
							return;
						}
						

						if(game.device.desktop){
							return;
						}
						
						//alert("createGyro"+player);
						// setting gyroscope update frequency
						gyro.frequency = 10;
						// start gyroscope detection





						gyro.startTracking(function(o) {


							if(!app.game.enableGyro){
								return;
							}

							if(o.gamma < - 2)
							{
								acursors.left.isDown=true;
								acursors.right.isDown=false;
								app.game._gyroPreviousH = -1;
							 }
							else
							if(o.gamma  > 2)
							{
								acursors.left.isDown=false;
								acursors.right.isDown=true;
								app.game._gyroPreviousH = 1;
							 }
							else
							{
								// don't do anything if PreviousH was already 0
								if(app.game._gyroPreviousH != 0){
									acursors.left.isDown=false;
									acursors.right.isDown=false;
									app.game._gyroPreviousH = 0;
								}

							}



							if(o.beta < -2)
							{
							 
								acursors.up.isDown =true;
								acursors.down.isDown =false;
								app.game._gyroPreviousV = 1;

							}
							else
							if(o.beta > 2)
							{						 
								acursors.up.isDown =false;
								acursors.down.isDown =true;
								app.game._gyroPreviousV = -1;
							}
							else
							{
								// don't do anything if PreviousV was already 0
								if(app.game._gyroPreviousV != 0){
									acursors.up.isDown =false;
									acursors.down.isDown =false; 
									app.game._gyroPreviousV = 0;
								}
							}



						});

					},
				






